import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import axios from './axios-object';
import { getTemplateId, getDId, getStateValue, getAllFieldValues } from './values';

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing.unit * 2,
        color: theme.palette.text.secondary,
    },
    finalpaper: {
        // padding: theme.spacing.unit * 2,
        color: theme.palette.text.secondary,
        position: "relative",
        display: "inline-block"
    },
    image: {
        width: '100%',
    }
});

class ViewFinalData extends Component {
    constructor() {
        super();
        this.state = {
            data: [],
            tid: null,
            did: null,
            templateURL: null,
            formImageURL: null,
        }
    }

    static contextTypes = {
        router: PropTypes.object,
    }

    componentDidMount() {
        let tid = getTemplateId();
        let did = getDId();
        this.setState({ tid: tid, did: did });

        const url = window.URL.createObjectURL(new Blob([getStateValue("form-image")]));
        this.setState({ formImageURL: url });

        // Make a request to fetch the file data
        axios.get('/getTemplateFile/' + tid, { responseType: 'blob' })
            .then((response) => {
                const url = window.URL.createObjectURL(new Blob([response.data]));
                // Set the URL to a state variable
                this.setState({ templateURL: url });
            });

        const dataToSend = getAllFieldValues();

        // Filter out key-value pairs with null values
        const filteredData = Object.fromEntries(
            Object.entries(dataToSend).filter(([key, value]) => value !== null)
        );

        axios.post('/showFinalMarked/' + tid + '/' + did, filteredData)
            .then(response => this.setState({ data: response.data }));
    }

    handleSubmit = () => {
        const { tid, did } = this.state;

        const dataToSend = getAllFieldValues();

        // Filter out key-value pairs with null values
        const filteredData = Object.fromEntries(
            Object.entries(dataToSend).filter(([key, value]) => value !== null)
        );
        console.log(filteredData)

        // Check if there are non-null values to submit
        if (Object.keys(filteredData).length === 0) {
            alert('No data to submit.');
            return;
        }

        // Send a POST request to the server
        axios.post(`http://localhost:3001/saveResponse`, {userInput: filteredData, selectedFormId: getTemplateId()})
            .then(response => {
                // Handle success
                alert('Response Submitted');
                window.history.pushState({}, null, "/formsList");
                window.dispatchEvent(new Event('popstate'));
            })
            .catch(error => {
                // Handle error
                console.error('Error submitting response:', error);
                alert('Failed to submit response. Please try again.');
            });
    };

    render() {
        const { classes } = this.props;
        return (
            <div className={classes.root}>
                <Grid container wrap="nowrap" spacing={24}>
                    <Grid item xs={6}>
                        <Paper className={classes.paper}>
                            <img src={this.state.formImageURL} className={classes.image} alt='' />
                        </Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper className={classes.finalpaper}>
                            <img src={this.state.templateURL} className={classes.image} alt='' />

                            {this.state.data.map(function (field, key) {
                                return (
                                    <div>
                                        {Object.keys(field).map(data => {
                                            const st2 = {
                                                location: {
                                                    position: "absolute",
                                                    margin: "0 auto",
                                                    color: "black",
                                                    letterSpacing: "0.4em",
                                                    left: field[data]["lx"] + 0.5 + "%",
                                                    top: field[data]["ty"] + "%",
                                                }
                                            }
                                            return (
                                                <strong><div style={st2.location}>{data}</div></strong>
                                            )
                                        })}
                                    </div>
                                )
                            })}

                        </Paper>
                    </Grid>
                </Grid>
                <Button variant="contained" color="primary" className={classes.button} type="submit" onSubmit={this.Su}>
                    Submit Response
                </Button>
            </div>
        );
    }
}

ViewFinalData.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ViewFinalData);
